import React, { useState } from "react";
import S from "./CreateBreed.module.css";
function CreateBreed() {
  const [Breed, setBreed] = useState({
    name: "",
    height: "",
    weight: "",
    life_span: "",
    img: "",
    temperaments: [],
  });

  

  const handleChange = (e) => {
    setBreed({
      ...Breed,
      [e.target.name]: e.target.value,
    });
  };

  return (
    <div>
      <div className={S.container}>
        <form>
          <input
            required
            name="name"
            type="text"
            placeholder="Name"
            autoComplete="off"
            onChange={handleChange}
          />
          <input
            required
            name="weight"
            type="number"
            placeholder="Weight"
            onChange={handleChange}
            min="1"
          />
          <input
            required
            name="height"
            type="number"
            placeholder="Height"
            onChange={handleChange}
            min="1"
          />
          <input
            required
            name="life_span"
            type="number"
            placeholder="Life span"
            onChange={handleChange}
            min="1"
          />
          <input
            required
            name="img"
            type="link"
            placeholder="Image Link/Url"
            onChange={handleChange}
            min="1"
          />
          <input type='submit'></input>
        </form>
      </div>
    </div>
  );
}

export default CreateBreed;
